import React, { createRef, Component } from 'react';
import { Map, Marker, Popup, TileLayer } from 'react-leaflet'

type State = {
	center: {
		x: number,
		y: number,
		zoom: number
	},
	position: {
		lat: number,
		lon: number
	}
}

class LatLongMap extends Component<{}, State> {
  	state = {
    	center: { x: 0, y: 0, zoom: 13 },  
    	position: null
    }

	mapRef = createRef()

	handleClick(num, lat, lon) {
		return () => {
	    	const map = this.mapRef.current
	    	if (map != null) {
	      		map.leafletElement.locate()
	    	}
			console.log("You clicked item " + num + ": " + lat + ", " + lon)
			console.log(this)
		}
  	}

	render() {
		const lat = this.state.position.lat
		const lon = this.state.position.lon
    	const marker = this.state.position != null ? (
      		<Marker position={lat, lon}>
        		<Popup>You are @ {lat}, {lon}</Popup>
      		</Marker>
    	) : null

    	return (
      		<Map
        		center={[this.state.center.x, this.state.center.y]}
        		length={4}
        		onClick={this.handleClick()}
        		ref={this.mapRef}
        		zoom={this.state.center}>
       		<TileLayer
          		attribution='&amp;copy <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
          		url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        	/>
        	{marker}
      		</Map>
    	)
  	}
}

const LatLongList = ({latLongs}) => {
	var num = -1;
	return <table>
		<tbody>
			{latLongs.map(latLong => {
				num = num + 1
				var lat = latLong.latitude
				var lon = latLong.longitude
				return <tr key={lat + "," + lon}>
					<td onClick={this.handleClick(num, lat, lon)}>{lat + ", " + lon}</td>
				</tr>
				}
			)}
		</tbody>
    </table>
}

const LatLongsComponent = ({latLongs}) => (
    <table>
		<tbody>
			<tr>
				<td><LatLongList latLongs={latLongs}/></td>
				<td><LatLongMap center={[0, 0]} zoom={13} position={[0, 0]}/></td>
			</tr>
		</tbody>
    </table>
  )


export default LatLongsComponent;
